export const getAllServicesService = async () => {
    const response = await fetch(`${process.env.REACT_APP_BACKEND}`);

    const json = await response.jon();

    console.log(json.message);

    console.log(response);

    if (!response.ok) {
        throw new Error(json.message);
    }

    return json.data;
};
